import Container from "@mui/material/Container";
import { Routes, Route } from "react-router-dom";

import React from "react";
import { Header } from "./components";
import { Home, Registration, Login, AddRasp } from "./pages";
import { useDispatch, useSelector } from "react-redux";
import { fetchAuthMe, selectIsAuth } from "./redux/slices/auth";
import { AddTime } from "./pages/AddTime";

function App() {
  const dispatch = useDispatch();
  const isAuth = useSelector(selectIsAuth);

  React.useEffect(() => {
    dispatch(fetchAuthMe());
  }, []);
  return (
    <>
      <Header />
      <Container maxWidth="lg">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/rasps/:id/edit" element={<AddRasp />} />
          <Route path="/add-rasp" element={<AddRasp />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Registration />} />
          <Route path="/add-time" element={<AddTime/>} />
          <Route path="/times/:id/edit" element={<AddTime/>} />
          <Route path="/add-day" element={<AddTime/>} />
          <Route path="/days/:id/edit" element={<AddTime/>} />
        </Routes>
      </Container>
    </>
  );
}

export default App;
